import React, { useEffect, useState } from "react";
import {
  Table,
  TableHead,
  TableBody,
  TableCell,
  TableRow,
} from "@mui/material";

const Vendor = ({ product }) => {
  const [vendorVariants, setVendorVariants] = useState([]);

  useEffect(() => {
    const vendorVariants = product.vendors.map((vendor) => ({
      vendorName: vendor.nameV,
      variants: vendor.variants.map((variant) =>
        Object.entries(variant)
          .map(([key, value]) => `${value}`)
          .join(" : ")
      ),
    }));
    setVendorVariants(vendorVariants);
  }, [product.vendors]);

  return (
    <div className="vendor-detail">
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Vendors detail</TableCell>
          </TableRow>
          <TableRow>
            {vendorVariants.map((vendor, index) => (
              <TableCell key={index}>{vendor.vendorName}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          <TableRow>
            {vendorVariants.map((vendor, index) => (
              <TableCell key={index}>
                {vendor.variants.map((variant, variantIndex) => (
                  <div key={variantIndex}>{variant}</div>
                ))}
              </TableCell>
            ))}
          </TableRow>
        </TableBody>
      </Table>
    </div>
  );
};

export default Vendor;
